import "./art_section_home.css";
import React from "react";

class ArtSectionHome extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <>



          <div className="parentHome" >
                       <h2>Some Artwork</h2>                    
                    <div className="containerHome">


                            {/* <div className="image"> */}

                                <img src="/assets/art2.jpg" alt="art" />

                            {/* </div> */}

                            <div className="childHomeContainerOne">
                                    <h3>Title</h3>
                                    <p>Lorem Ipsum is simply dummy text  of <br/> the printing  and 
                                        typesetting industry.<br/> Lorem Ipsum has been  the industry's <br/>
                                        standard dummy text ever since  the <br/>  1500s, 
                                        software like Aldus  PageMaker <br/> including versions of Lorem Ipsum.<br/>
                                        Lorem Ipsum has been the industry's <br/>
                                        standard dummy text ever since the<br/>  1500s, 
                                        software like Aldus PageMaker<br/>
                                        including versions of Lorem Ipsum
                                    </p>
                            </div>

                     </div>





                     <div className="containerHome">


                            {/* <div className="image"> */}

                                <img src="/assets/art1.jpg" alt="art" />

                            {/* </div> */}

                            <div className="childHomeContainerTwo">
                                    <h3>Title</h3>
                                    <p>Lorem Ipsum is simply dummy text  of <br/> the printing  and 
                                        typesetting industry.<br/> Lorem Ipsum has been  the industry's <br/>
                                        standard dummy text ever since  the <br/>  1500s, 
                                        software like Aldus  PageMaker <br/> including versions of Lorem Ipsum.<br/>
                                        Lorem Ipsum has been the industry's <br/>
                                        standard dummy text ever since the<br/>  1500s, 
                                        software like Aldus PageMaker<br/>
                                        including versions of Lorem Ipsum
                                    </p>
                            </div>


          <button className="btnAuthor">Show More</button>


                     </div>

            </div>









            </>
        );
    }
}

export default ArtSectionHome;
